//Import package
import { BrowserRouter } from "react-router-dom";

//Import styles
import "bootstrap/dist/css/bootstrap.min.css";

//Import Components
// import { NavMenuModule } from "./components/NavBar";

//Import Pag
// import Pagina from "./routes/index";

/* const App = ()=>{
    return (
        <BrowserRouter>
            <NavMenuModule/>
            <Pagina/>
        </BrowserRouter>
    );
}; */
import {
  Navbar,
  NavbarBrand,
  NavbarToggler,
  Collapse,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownMenu,
  DropdownItem,
  NavbarText,
  DropdownToggle,
  Input
} from "reactstrap";

const App = () => {
  return (
    <div>
      <Navbar color="dark" dark expand="md">
        <NavbarBrand href="/">Allstudy</NavbarBrand>
        <NavbarToggler onClick={function noRefCheck() {}} />
        <Collapse navbar>
          <Nav className="me-auto" navbar>
            <NavItem>
              <NavLink href="/">Home</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href=""></NavLink>
            </NavItem>
            <UncontrolledDropdown inNavbar nav>
              <DropdownToggle caret nav>
                Categor√≠a
              </DropdownToggle>
              <DropdownMenu right>
                <DropdownItem>Option 1</DropdownItem>
                <DropdownItem>Option 2</DropdownItem>
                <DropdownItem divider />
                <DropdownItem>Option 3</DropdownItem>
                <DropdownItem>Option 4</DropdownItem>
                <DropdownItem>Option 5</DropdownItem>
                <DropdownItem divider />
                <DropdownItem>Option 6</DropdownItem>
                <DropdownItem>Option 7</DropdownItem>
              </DropdownMenu>
            </UncontrolledDropdown>
            
          </Nav>
          <NavbarText>Search</NavbarText>
          <Input bsSize="sm"/>
        </Collapse>
      </Navbar>
    </div>
  );
};

export default App;
